import './header.css';
import './footer.css';

export default function App() {
  return (
    <div className="App flex flex-col">
      <Navbar />
      <Welcome />
      <HomepageCarousel />
      <Footer />
    </div>
  );
}

function Navbar() {
  return (
    <header className="md:flex md:flex-row">
      <div>
        <img src="images/logo.png" alt="Logo PetMeeting" width={400} />
      </div>
      <nav className="container md:flex md:flex-row mx-auto my-auto md:h-12">
        <ul className="flex-col max-w-max mx-auto my-auto text-white text-2xl m-0 md:flex md:flex-row md:pt-0">
          <li className="md:mt-1.5 md:mr-6 lg:mr-12 text-center hover:animate-pulse">ANNONCES</li>
          <li className="md:mt-1.5 md:mb-1 md:mr-6 lg:mr-12 text-center hover:animate-pulse">PUBLIER</li>
          <li className="md:mt-1.5 md:mr-6 lg:mr-12 text-center hover:animate-pulse">MEMBRES</li>
          <li className="md:mt-1.5 md:mr-6 lg:mr-12 text-center hover:animate-pulse">CONTACT</li>
        </ul>
        <div className='parallelogram w-md:ml-6 lg:ml-20 flex flex-row'>
          <ul className='nav-icons-connected md:flex md:flex-row mb-1'>
            <li className='icon-user md:mr-5'><img src="images/user.svg" alt="Profil de l'utilisateur" width={34} /></li>
            <li className='icon-msg md:mr-5'><img src="images/messages.svg" alt="Messages de l'utilisateur" width={34} /></li>
            <li className='icon-logout'><img src="images/logout.svg" alt="Profil de l'utilisateur" width={34} /></li>
          </ul>
        </div>
      </nav>
    </header>
  );
}

function Welcome() {
  return (
    <div>Welcome!</div>
  );
}

function HomepageCarousel() {
  return (
    <div>Carousel</div>
  );
}

function Footer() {
  return (
    <footer>Tous droits réservés PetMeeting 2024</footer>
  );
}
